import './App.css';
import { Player, Controls } from '@lottiefiles/react-lottie-player';

function App() {
  return (
    <div className="App">
      <Player
        autoplay
        loop
        src="https://lottiefiles.com/119968-alien-spaceship-abducting-a-cat-404-error"
        style={{ height: '300px', width: '300px' }}
